import './App.css';
import Navbar from "./components/navbar";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import About from "./pages/about";


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <BrowserRouter>
            <Navbar />
            <Switch>
                <Route path="/about" component={About} />
            </Switch>
        </BrowserRouter>

      </header>
    </div>
  );
}

export default App;
